import React from 'react'
import { Routes, Route, Router } from "react-router-dom";
import Hangman from './Hangman';
import { Link } from 'react-router-dom';



function App() {
  return (
    <div className="App">
      <Router>
        <div>
          <Nav />
          <Switch>
            <Route exactly component={Hangman} pattern="/" />



            <Route component={Page404} />
          </Switch>
        </div>
      </Router>
    </div>
  );
}

export default App;
